import React from 'react';
import { Link } from 'react-router-dom';

import './Button.css';

const Button = propss => {
  if (propss.href) {
    return (
      <a
        className={`button button--${propss.size || 'default'} ${propss.inverse &&
          'button--inverse'} ${propss.danger && 'button--danger'}`}
        href={propss.href}
      >
        {propss.children}
      </a>
    );
  }
  if (propss.to) {
    return (
      <Link
        to={propss.to}
        exact={propss.exact}
        className={`button button--${propss.size || 'default'} ${propss.inverse &&
          'button--inverse'} ${propss.danger && 'button--danger'}`}
      >
        {propss.children}
      </Link>
    );
  }
  return (
    <button
      className={`button button--${propss.size || 'default'} ${propss.inverse &&
        'button--inverse'} ${propss.danger && 'button--danger'}`}
      type={propss.type}
      onClick={propss.onClick}
      disabled={propss.disabled}
    >
      {propss.children}
    </button>
  );
};

export default Button;
